window.bookSummaryJSON = "<p>Kit Colbana - half breed, assassin, thief, jack of all trades - has a new job: track down the missing ward of one of the local alpha shapeshifters. It should be a piece of cake. </p><p>So why is she so nervous? It probably has something to do with the insanity that happens when you deal with shifters - especially sexy ones who come bearing promises of easy jobs and easier money. </p><p>Or maybe it's all the other missing kids that Kit discovers while working the case, or the way her gut keeps screaming she's gotten in over her head. Or maybe it's because if she fails - she's dead. </p><p>If she can stay just one step ahead, she should be okay. Maybe she'll even live long to collect her fee.... </p>"; 
